import React, { Component } from "react";
import Cards from "./Cards";
import "./CardList.css";

class CardList extends Component {
  render() {
    const { robots } = this.props;
    return (
      <div className="main">
        {robots.map((user, i) => {
          return (
            <Card
              key={i}
              id={robots[i].id}
              name={robots[i].name}
              email={robots[i].email}
            />
          );
        })}
        <Cards name={robots.cards[0].title} />
        <Cards />
        <Cards />
      </div>
    );
  }
}

export default CardList;
